import React, { Fragment, useState } from 'react';
import './App.css';

function App() {
	const [title, setTitle] = useState(['Tên', 'Tuổi', 'Email', 'Tên đăng nhập'])
	const [students, setStudents] = useState([
		{
			name: 'Nguyen Van A',
			age: 20,
			email:'nguyenvana@gmail.com',
			nname: 'nguyenvana'
		},{
			name: 'Nguyen Van B',
			age: 21,
			email:'nguyenvanb@gmail.com',
			nname: 'nguyenvanb'
		},{
			name: 'Nguyen Van C',
			age: 22,
			email:'nguyenvanc@gmail.com',
			nname: 'nguyenvanc'
		}
	])
	return (
		<Fragment>
			<table>
				<tr>
					{
						title.map(t => {
							return <th>{t}' '</th>
						})
					}
				</tr>
				{
					students.map(s => {
						return <tr>
							<td>{s.name}</td>
							<td>{s.age}</td>
							<td>{s.email}</td>
							<td>{s.nname}</td>
						</tr>
					})
				}
			</table>
		</Fragment>
	)
}

export default App
